 @hebertegomesdossantos8773  pra vc ver né? Se isso fosse verdade o jogo seria uns 3 ou 4 pro Palmeiras mas não foi isso que vimos na final ... na minha opinião uma final estranha pq o Santos literalmente tirou o pé justo na final ...  tinha feito os 6 últimos jogos comendo a bola ,
Venceu A forte LDU fora de casa , jogou bem na vila no jogo de volta apesar de ter perdido a partida e depois fez 2 ótimos jogos contra o grêmio, depois outros 2 ótimos jogos contra o boca jrs. E justo na final simplesmente tirou o pé e nem de longe era o Santos que vinha jogando... pra mim está final cheira a manipulação e muita grana da Leila para os cofres do Santos que até então vivia uma crise financeira ... tanto é que depois da final o cuca disse em entrevista que iria sair do Santos por uns motivos que ele alegou não compactuar e decidiu sair  ... estranho não?  
Pra mim essa final foi vendida ...

